description:
Yakkity Yak is a television program that ran on Nickelodeon from November 9 to December 12, 2003. Yakkity Yak was canceled on December 11 with 26 episodes, due to a generally low fanbase.

The show features a cartoon yak named Yakkity who wants to make it to stardom by becoming a comedian. Along the way, he has adventures with his two best friends Keo (an actual anthropomorphic pineapple) and Lemony.
